import React from 'react'


const BASE = () => {
  const base = {
    'red' : {
      name : 'red',
      color: 'red'
    },
    'blue' : {
      name : 'blue color',
      color: 'blue'
    },
    default : {
      name: 'grey',
      color: 'grey'
    }
  }
  return base;
}

function Arcoiris(props) {
  const base = BASE();
  return (
    <div style={{
      width : '300px',
      height : '300px',
      background: base[props.color].color
    }}>
      <h2>{base[props.color].name}</h2>
    </div>
  )
}



export default Arcoiris
